import React from 'react';
import { NavLink } from './NavBar/NavLink';

export default class NavBar extends React.Component {
    constructor(props) {
        super(props);
        this.state = {  }
    }
    render() { 
        return (

           <div className='nav-bar-container'>
                <NavLink  tab={'About'}  />
                <NavLink  tab={'What I Do'}  />
                <NavLink  tab={'Projects'}  />
                <NavLink  tab={'Contact'}  />
            </div>
        );
    }
}
